import { useSelector } from "react-redux";
const Counter = () => {
  const data = useSelector((data) => {
    return data;
  });
  console.log(data);
  return (
    <>
      <h1>inc : 1</h1>
      <h1>dec : 2</h1>
      <button>inc</button>
      <button>dec</button>
    </>
  );
};
export default Counter;
